class Hooks(idaapi.UI_Hooks):
    def populating_tform_popup(self, form, popup):
        global highlight
        
        if idaapi.get_tform_type(form) == idaapi.BWN_DISASM:
            #ida 7.0
            #highlight = idaapi.get_highlight(form)
            #ida 6.8 higher
            highlight = idaapi.get_highlighted_identifier()
            if highlight:
                idaapi.update_action_label("search:google_action", "Search Google for \"" + highlight + "\"")
                idaapi.attach_action_to_popup(form, popup, "search:google_action", None)
                idaapi.update_action_label("search:baidu_action", "Search Baidu for \"\"" + highlight + "\"")
                idaapi.attach_action_to_popup(form, popup, "search:baidu_action", None)
                idaapi.update_action_label("search:bing_action", "Search Bing for \"\"" + highlight + "\"")
                idaapi.attach_action_to_popup(form, popup, "search:bing_action", None)



class SEARCH(idaapi.plugin_t):
    flags = idaapi.PLUGIN_PROC
    comment = "Search Google for it"
    help = "Search Google for it"
    wanted_name = "Search Google for it"
    wanted_hotkey = ""

    def init(self):
        self._hooks = Hooks()
        self._hooks.hook()

        return idaapi.PLUGIN_KEEP

    def term(self):
        pass

    def run(self, arg):
        pass
        
def PLUGIN_ENTRY():
    return SEARCH()